import React from "react";
import "Navbar.css";

const Navbar = () => {
  return (
    <div className="nav_container">
        <ul className="nav_list">
            <li className="nav_item">Home</li>
            <li className="nav_item">Program</li>
            <li className="nav_item">Handbook</li>
            <li className="nav_item">Regulament</li>
            <li className="nav_item">Sponsori</li>
            <li className="nav_item">Programare imprimare</li>
        </ul>
    </div>
    );
};

export default Navbar;
